const Weather = props => (
    <div>
        {
            props.city && props.country && 
                <p>LOCATION : 
                    <span>{props.city}, {props.country}</span>
                </p> 
        }
        {
            props.temperature && 
            <p>TEMPERATURE : 
                <span>{props.temperature}</span>
            </p> 
        }
        {
            props.humidity && 
                <p>HUMIDITY : 
                    <span>{props.humidity}</span>
                </p> 
        }
        {
            props.description && 
                <p>CONDITIONS :     
                    <span>{props.description}</span>
                </p> 
        }
        {
            props.error && <p>{props.error}</p>
        }
    </div>  
);


export default Weather;
